import './style.css';
//              component: P List Item  컴포넌트     //
export default function PListItem() {
  //              render: P List Item  컴포넌트     //
  return (
    <div className="p-list-item">
      <div className="p-list-item-main-box">
        <div className="p-list-item-top">
          <div className="p-list-item-profile-box">
            <div
              className="p-list-item-profile-image"
              style={{
                backgroundImage:
                  'url(https://images.pexels.com/photos/20386572/pexels-photo-20386572.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1)',
              }}
            ></div>
          </div>
          <div className="p-list-item-write-box">
            <div className="p-list-item-nickname">
              {'안녕하세여나는주코야키'}
            </div>
            <div className="p-list-item-write-date">{'2022. 05. 12.'}</div>
          </div>
        </div>
        <div className="p-list-item-middle">
          <div className="p-list-item-title">{'오늘 점심 뭐 먹지?'}</div>
          <div className="p-list-item-content">{'오늘 뭐 먹을까?'}</div>
        </div>
        <div className="p-list-item-bottom">
          <div className="p-list-item-counts">
            {'댓글 0 · 좋아요 0 · 조회수 0'}
          </div>
        </div>
      </div>
      <div className="p-list-item-image-box">
        <div
          className="p-list-item-image"
          style={{
            backgroundImage:
              'url(https://images.pexels.com/photos/20386572/pexels-photo-20386572.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1)',
          }}
        ></div>
      </div>
    </div>
  );
}
